"use strict";(self.webpackChunkmy_app=self.webpackChunkmy_app||[]).push([[418],{418:e=>{e.exports=JSON.parse('{"email":"Send meg en e-post","cv":"CV-en min","role":"Programvareutvikler og Norge-entusiast","description":"Heisann! Jeg er en {age} \xe5r gammel Full Stack Programvareutvikler, spesialisert i front-end development. Jeg har fulgt et 4-\xe5rige IT {bachelorLink} ved Hogeschool Utrecht, Nederland. Jeg har {experience}+ \xe5rs arbeidserfaring, hovedsakelig med React Javascript & Java Spring.","iam":"Jeg er","availability":"Tilgjengelig for frilans, fjernarbeid eller flytting til Norge.","norwaypart1":"Norge har alltid v\xe6rt mer enn bare et sted p\xe5 kartet for meg. Det fantastiske landskapet, den rike historien og en blanding av tradisjon og modernitet har fengslet meg. \xc5 v\xe6re flytende i norsk har styrket min tilknytning til kulturen, og gjort hver opplevelse\u2014fra \xe5 utforske fjorder til \xe5 engasjere seg i de varme samfunnene\u2014mye mer meningsfull.","norwaypart2":"Jeg er inspirert av Norges vennlighet og b\xe6rekraft og venter spent p\xe5 dagen jeg kan kalle dette ekstraordin\xe6re landet mitt hjem.","skillstitle":"Mine ferdigheter","skillsdescription":"Utforsk programvareferdighetene jeg har for \xe5 bringe ideer ut i livet med enkelhet og presisjon.","frontenddescription":"Jeg elsker \xe5 lage gode, brukervennlige nettsider \u2013 spesielt med React og JavaScript \u2013 med fokus p\xe5 design som folk faktisk liker \xe5 bruke. Jeg har ofte kontakt med kunden for \xe5 h\xf8re deres \xf8nsker og elsker \xe5 f\xe5 tilbakemelding p\xe5 arbeidet mitt, spesielt n\xe5r kunden elsker arbeidet jeg leverer. Jeg er i stand til \xe5 bytte til hvilket som helst framework etter \xe5 ha jobbet med ganske mange tidligere, og liker \xe5 bruke b\xe5de Javascript og Typescript.","backenddescription":"Jeg har mye erfaring med \xe5 jobbe med objektorienterte prosjekter, spesielt med Java og Spring. Jeg har bygget tusenvis av forskjellige applikasjoner, kj\xf8rt dem gjennom end-to-end (og unit) tests med JUnit5 og Mockito og s\xf8rget for at hele applikasjonen forsatt \xe5 fungere med en CI/CD-pipeline. Jeg har ogs\xe5 laget flere databaser med PostgreSQL og Hibernate, koblet den til en Java-applikasjon og f\xe5tt dem til \xe5 fungere feilfritt.","toolstitle":"Verkt\xf8y & Platformer","toolsdescription":"Etter \xe5 ha brukt Git for versjonskontroll og GitHub for (blant annet) pipelines, prosjektlagring og scrum boards, kjenner jeg veien rundt med alle disse verkt\xf8yene. Jeg har brukt Postman for \xe5 teste API-ene jeg har laget/jobbet med og kan bruke kommandolinjen til \xe5 jobbe med Git/deploye applikasjoner p\xe5 f.eks. Azure DevOps. Jeg vet ogs\xe5 hvordan jeg jobber med flere IDE-er, hvor Visual Studio Code er min favoritt.","worktitle":"Mine prosjekt","workdescription":"Ta en titt p\xe5 alle produktene jeg har laget for skoleprosjekt, praksisplasser, sideprosjekter og jobber.","luftandescription":"Luftan er et svensk selskap som spesialiserer seg p\xe5 aromadiffusorer og skandinavisk-inspirerte dufter. Prosjektet inkluderer en full e-handelsplattform der brukere kan bla gjennom produkter, legge til varer i handlekurven og legge inn bestillinger. Jeg utviklet hele siden fra bunnen av, og dekker b\xe5de front-end og back-end utvikling.","candidateportaldescription":"Mysolution er et internasjonalt selskap som tilbyr en Salesforce-applikasjon for rekrutteringsbyr\xe5er. I mitt internship for HBO Bachelor IT Software Development-studiet m\xe5tte jeg opprette en onboarding-portal for en kunde av Mysolution, slik at de ansatte til nevnte kunde kunne fylle ut sin legitimasjon (personalia, bankkontoinformasjon, personvernerkl\xe6ringer osv.). Jeg m\xe5tte ogs\xe5 forske p\xe5 hvordan man h\xe5ndterer sanselig brukerdata i henhold til EU-loven (GDPR) og be brukere om tillatelse til \xe5 lagre dataene deres.","huskelistedescription":"HuskeListe er en enkel norsk gj\xf8rem\xe5lsapp som lar brukere legge til, krysse av og fjerne oppgaver fra listene sine, og hjelpe dem med \xe5 holde orden.","smartfinancedescription":"SmartFinance er en nettapplikasjon for Hogeschool Utrechts \'Bedrijfskunde\'-studenter. Det hjelper dem \xe5 \xf8ve seg p\xe5 \xe5 lage \'jaarrekeningen\' (\xe5rsregnskap) og gir umiddelbar tilbakemelding for \xe5 forberede seg til tester og lekser.","kpndescription":"KPN Reisbewegingen er et nettsted for KPN-ansatte for \xe5 logge sine reisedata, som deretter settes sammen til en Excel-rapport. Ledere kan se avdelingsstatistikk, og en ledertavle oppfordrer til \xe5 redusere CO2-utslipp.","seeproject":"Se prosjekt"}')}}]);